})
export class StarComponent implements OnInit {
  @Input() rating: number;
  starWidth: number;
  @Output() ratingClinked: EventEmitter<string> =
  new EventEmitter<string>();

  constructor() {
    this.rating = 0;
    this.starWidth = this.rating * 75/5;
  }

  ngOnChanges(): void {
    this.starWidth = this.rating * 75/5;
